import './App.css';
import React, { useState, useEffect } from 'react';

function App() {

    const [photos, setPhotos] = useState([]);
    const apiKey = 'SudUi7PHizIEvv-99zhBa4q86SYxr_QA_xy13BhVmbY';
    const query = 'arte+abstracto';

    useEffect(() => {
      fetch(`https://api.unsplash.com/search/photos?query=${query}`, {
        headers: {
          Authorization: `Client-ID ${apiKey}`
        }
      })
        .then(response =>{ 
          console.log(response.json())
        })
        .then(data => {
          console.log(data)
        })
        .catch(error => {
          console.log('Error:', error);
        });



      const fetchPhotos = async () => {
        try {
          const response = await fetch(`https://api.unsplash.com/search/photos?query=${query}`, {
              headers: {
                Authorization: `Client-ID ${apiKey}`
              }
            }
          )

          const data = await response.json();
          setPhotos(data);
        } catch (error) {
          console.log('Error fetching photos:', error);
        }
      };

      fetchPhotos();
    }, []);

  return (
<div>
      <h2>Unsplash Photos</h2>
      <div>
        {photos.map((photo) => (
          <img key={photo.id} src={photo.urls.small} alt={photo.alt_description} />
        ))}
      </div>
    </div>
  );
}

export default App;
